export const generateDialogableRoute = (component, {
  path = '',
  ...dialogOptions
} = {}) => {
  return {
    path,
    loadComponent: () => import('../../routable-dialog.component').then(m => m.RoutableDialogComponent),
    data: {
      dialog: component,
      isLazy: true,
      dialogOptions
    }
  };
};
